import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent {
  title = 'app';
}

<body>
  <app-nav-menu></app-nav-menu>
  <nav>
    <button class="movie-list"routerLink="/event-list" routerLinkActive="activeLink">Movie List</button>
   <button class="watch-list" routerLink="/watch-list" routerLinkActive="activeLink">My Watch List</button>

   <li class="nav-item" [routerLinkActive]="['link-active']">
    <a class="nav-link text-dark" [routerLink]="['/favorite-list']"
      >Favorites</a>
  </li>

  </nav>
  <router-outlet></router-outlet>

</body>
